import { Table } from '../components/table';
import { Link } from 'react-router-dom';

export const ListUsers = () => {
  return (
    <div className="row mt-5">
      <h1>List User</h1>
      <hr />
      <Table />
      <Link to='./issues/list'><button type="button" className='btn btn-primary'> Add User</button></Link>

    </div>
  )
}
